import React from "react";

import {
	SearchFilterContainer,
	SearchFilterItems,
	SearchFilterItem,
} from "./SearchFilter.styles";

const SearchFilter = () => {
	return (
		<SearchFilterContainer>
			<SearchFilterItems></SearchFilterItems>
		</SearchFilterContainer>
	);
};

export default SearchFilter;
